import React from "react";
import "../stylesheets/footer.css";

// component to display footer
const Footer = () => {
    return (
        <footer>
            <div className="name">
                <span style={{ fontWeight: "500" }}>Built By</span> Team
            </div>
        </footer>
    );
};

export default Footer;
